@testset "4.1.1.2 (g cos)^p (a+b sin)^m" begin
    (a, b, c, d, e, f, m, p, x, ) = @variables a b c d e f m p x

    #= ::Package:: =#

    #= ::Title:: =#
    #=Integrands*of*the*form*(g*cos(e+f*x))^p*(a+b*sin(e+f*x))^m=#


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(g*cos(e+f*x))^p*(a+b*sin(e+f*x))^m*when*a^2-b^2=0=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*cos(e+f*x)^p*(a+a*sin(e+f*x))^m=#


    #= ::Subsubsection::Closed:: =#
    #=m>0=#


    @test_int [cos(c + d*x)^7*(a + a*sin(c + d*x)), x, 3, (8*(a + a*sin(c + d*x))^5)/(5*a^4*d) - (2*(a + a*sin(c + d*x))^6)/(a^5*d) + (6*(a + a*sin(c + d*x))^7)/(7*a^6*d) - (a + a*sin(c + d*x))^8/(8*a^7*d)]
    @test_int [cos(c + d*x)^6*(a + a*sin(c + d*x)), x, 5, (5*a*x)/16 - (a*cos(c + d*x)^7)/(7*d) + (5*a*cos(c + d*x)*sin(c + d*x))/(16*d) + (5*a*cos(c + d*x)^3*sin(c + d*x))/(24*d) + (a*cos(c + d*x)^5*sin(c + d*x))/(6*d)]
    @test_int [cos(c + d*x)^5*(a + a*sin(c + d*x)), x, 3, (a + a*sin(c + d*x))^4/(a^3*d) - (4*(a + a*sin(c + d*x))^5)/(5*a^4*d) + (a + a*sin(c + d*x))^6/(6*a^5*d)]
    @test_int [cos(c + d*x)^4*(a + a*sin(c + d*x)), x, 4, (3*a*x)/8 - (a*cos(c + d*x)^5)/(5*d) + (3*a*cos(c + d*x)*sin(c + d*x))/(8*d) + (a*cos(c + d*x)^3*sin(c + d*x))/(4*d)]
    @test_int [cos(c + d*x)^3*(a + a*sin(c + d*x)), x, 3, (2*(a + a*sin(c + d*x))^3)/(3*a^2*d) - (a + a*sin(c + d*x))^4/(4*a^3*d)]
    @test_int [cos(c + d*x)^2*(a + a*sin(c + d*x)), x, 3, (a*x)/2 - (a*cos(c + d*x)^3)/(3*d) + (a*cos(c + d*x)*sin(c + d*x))/(2*d)]
    @test_int [cos(c + d*x)^1*(a + a*sin(c + d*x)), x, 2, (a + a*sin(c + d*x))^2/(2*a*d), (a*sin(c + d*x))/d + (a*sin(c + d*x)^2)/(2*d)]
    @test_int [sec(c + d*x)^1*(a + a*sin(c + d*x)), x, 2, -((a*log(1 - sin(c + d*x)))/d)]
    @test_int [sec(c + d*x)^2*(a + a*sin(c + d*x)), x, 3, (a*sec(c + d*x))/d + (a*tan(c + d*x))/d]
    @test_int [sec(c + d*x)^3*(a + a*sin(c + d*x)), x, 4, (a*atanh(sin(c + d*x)))/(2*d) + a^2/(2*d*(a - a*sin(c + d*x)))]
    @test_int [sec(c + d*x)^4*(a + a*sin(c + d*x)), x, 3, (a*sec(c + d*x)^3)/(3*d) + (a*tan(c + d*x))/d + (a*tan(c + d*x)^3)/(3*d)]
    @test_int [sec(c + d*x)^5*(a + a*sin(c + d*x)), x, 4, (3*a*atanh(sin(c + d*x)))/(8*d) + a^3/(8*d*(a - a*sin(c + d*x))^2) + a^2/(4*d*(a - a*sin(c + d*x))) - a^2/(8*d*(a + a*sin(c + d*x)))]


    @test_int [cos(c + d*x)^6*(a + a*sin(c + d*x))^2, x, 6, (45*a^2*x)/128 - (9*a^2*cos(c + d*x)^7)/(56*d) + (45*a^2*cos(c + d*x)*sin(c + d*x))/(128*d) + (15*a^2*cos(c + d*x)^3*sin(c + d*x))/(64*d) + (3*a^2*cos(c + d*x)^5*sin(c + d*x))/(16*d) - (cos(c + d*x)^7*(a^2 + a^2*sin(c + d*x)))/(8*d)]
    @test_int [cos(c + d*x)^5*(a + a*sin(c + d*x))^2, x, 3, (4*(a + a*sin(c + d*x))^5)/(5*a^3*d) - (2*(a + a*sin(c + d*x))^6)/(3*a^4*d) + (a + a*sin(c + d*x))^7/(7*a^5*d)]
    @test_int [cos(c + d*x)^4*(a + a*sin(c + d*x))^2, x, 5, (7*a^2*x)/16 - (7*a^2*cos(c + d*x)^5)/(30*d) + (7*a^2*cos(c + d*x)*sin(c + d*x))/(16*d) + (7*a^2*cos(c + d*x)^3*sin(c + d*x))/(24*d) - (cos(c + d*x)^5*(a^2 + a^2*sin(c + d*x)))/(6*d)]
    @test_int [cos(c + d*x)^3*(a + a*sin(c + d*x))^2, x, 3, (a + a*sin(c + d*x))^4/(2*a^2*d) - (a + a*sin(c + d*x))^5/(5*a^3*d)]
    @test_int [cos(c + d*x)^2*(a + a*sin(c + d*x))^2, x, 4, (5*a^2*x)/8 - (5*a^2*cos(c + d*x)^3)/(12*d) + (5*a^2*cos(c + d*x)*sin(c + d*x))/(8*d) - (cos(c + d*x)^3*(a^2 + a^2*sin(c + d*x)))/(4*d)]
    @test_int [cos(c + d*x)^1*(a + a*sin(c + d*x))^2, x, 2, (a + a*sin(c + d*x))^3/(3*a*d)]
    @test_int [sec(c + d*x)^1*(a + a*sin(c + d*x))^2, x, 3, (-2*a^2*log(1 - sin(c + d*x)))/d - (a^2*sin(c + d*x))/d]
    @test_int [sec(c + d*x)^2*(a + a*sin(c + d*x))^2, x, 3, (-a^2)*x + (2*a^4*cos(c + d*x))/(d*(a^2 - a^2*sin(c + d*x)))]
    @test_int [sec(c + d*x)^3*(a + a*sin(c + d*x))^2, x, 2, a^3/(d*(a - a*sin(c + d*x)))]
    @test_int [sec(c + d*x)^4*(a + a*sin(c + d*x))^2, x, 3, (a^4*cos(c + d*x))/(3*d*(a - a*sin(c + d*x))^2) + (a^4*cos(c + d*x))/(3*d*(a^2 - a^2*sin(c + d*x)))]
    @test_int [sec(c + d*x)^5*(a + a*sin(c + d*x))^2, x, 4, (a^2*atanh(sin(c + d*x)))/(4*d) + a^4/(4*d*(a - a*sin(c + d*x))^2) + a^3/(4*d*(a - a*sin(c + d*x)))]
    @test_int [sec(c + d*x)^6*(a + a*sin(c + d*x))^2, x, 3, (2*sec(c + d*x)^5*(a^2 + a^2*sin(c + d*x)))/(5*d) + (3*a^2*tan(c + d*x))/(5*d) + (a^2*tan(c + d*x)^3)/(5*d)]
    @test_int [sec(c + d*x)^7*(a + a*sin(c + d*x))^2, x, 4, (a^2*atanh(sin(c + d*x)))/(4*d) + a^5/(12*d*(a - a*sin(c + d*x))^3) + a^4/(8*d*(a - a*sin(c + d*x))^2) + (3*a^3)/(16*d*(a - a*sin(c + d*x))) - a^3/(16*d*(a + a*sin(c + d*x)))]
    @test_int [sec(c + d*x)^8*(a + a*sin(c + d*x))^2, x, 3, (2*sec(c + d*x)^7*(a^2 + a^2*sin(c + d*x)))/(7*d) + (5*a^2*tan(c + d*x))/(7*d) + (10*a^2*tan(c + d*x)^3)/(21*d) + (a^2*tan(c + d*x)^5)/(7*d)]


    @test_int [cos(c + d*x)^6*(a + a*sin(c + d*x))^3, x, 7, (55*a^3*x)/128 - (11*a^3*cos(c + d*x)^7)/(56*d) + (55*a^3*cos(c + d*x)*sin(c + d*x))/(128*d) + (55*a^3*cos(c + d*x)^3*sin(c + d*x))/(192*d) + (11*a^3*cos(c + d*x)^5*sin(c + d*x))/(48*d) - (a*cos(c + d*x)^7*(a + a*sin(c + d*x))^2)/(9*d) - (11*cos(c + d*x)^7*(a^3 + a^3*sin(c + d*x)))/(72*d)]
    @test_int [cos(c + d*x)^5*(a + a*sin(c + d*x))^3, x, 3, (2*(a + a*sin(c + d*x))^6)/(3*a^3*d) - (4*(a + a*sin(c + d*x))^7)/(7*a^4*d) + (a + a*sin(c + d*x))^8/(8*a^5*d)]
    @test_int [cos(c + d*x)^4*(a + a*sin(c + d*x))^3, x, 6, (9*a^3*x)/16 - (3*a^3*cos(c + d*x)^5)/(10*d) + (9*a^3*cos(c + d*x)*sin(c + d*x))/(16*d) + (3*a^3*cos(c + d*x)^3*sin(c + d*x))/(8*d) - (a*cos(c + d*x)^5*(a + a*sin(c + d*x))^2)/(7*d) - (3*cos(c + d*x)^5*(a^3 + a^3*sin(c + d*x)))/(14*d)]
    @test_int [cos(c + d*x)^3*(a + a*sin(c + d*x))^3, x, 3, (2*(a + a*sin(c + d*x))^5)/(5*a^2*d) - (a + a*sin(c + d*x))^6/(6*a^3*d)]
    @test_int [cos(c + d*x)^2*(a + a*sin(c + d*x))^3, x, 5, (7*a^3*x)/8 - (7*a^3*cos(c + d*x)^3)/(12*d) + (7*a^3*cos(c + d*x)*sin(c + d*x))/(8*d) - (a*cos(c + d*x)^3*(a + a*sin(c + d*x))^2)/(5*d) - (7*cos(c + d*x)^3*(a^3 + a^3*sin(c + d*x)))/(20*d)]
    @test_int [cos(c + d*x)^1*(a + a*sin(c + d*x))^3, x, 2, (a + a*sin(c + d*x))^4/(4*a*d)]
    @test_int [sec(c + d*x)^1*(a + a*sin(c + d*x))^3, x, 3, -((4*a^3*log(1 - sin(c + d*x)))/d) - (3*a^3*sin(c + d*x))/d - (a^3*sin(c + d*x)^2)/(2*d)]
    @test_int [sec(c + d*x)^2*(a + a*sin(c + d*x))^3, x, 4, -3*a^3*x + (3*a^3*cos(c + d*x))/d + (2*a^5*cos(c + d*x)^3)/(d*(a - a*sin(c + d*x))^2)]
    @test_int [sec(c + d*x)^3*(a + a*sin(c + d*x))^3, x, 3, (a^3*log(1 - sin(c + d*x)))/d + (2*a^4)/(d*(a - a*sin(c + d*x)))]
    @test_int [sec(c + d*x)^4*(a + a*sin(c + d*x))^3, x, 2, (a^6*cos(c + d*x)^3)/(3*d*(a - a*sin(c + d*x))^3)]
    @test_int [sec(c + d*x)^5*(a + a*sin(c + d*x))^3, x, 2, a^5/(2*d*(a - a*sin(c + d*x))^2)]
    @test_int [sec(c + d*x)^6*(a + a*sin(c + d*x))^3, x, 4, (a^6*cos(c + d*x))/(5*d*(a - a*sin(c + d*x))^3) + (2*a^5*cos(c + d*x))/(15*d*(a - a*sin(c + d*x))^2) + (2*a^6*cos(c + d*x))/(15*d*(a^3 - a^3*sin(c + d*x)))]
    @test_int [sec(c + d*x)^7*(a + a*sin(c + d*x))^3, x, 4, (a^3*atanh(sin(c + d*x)))/(8*d) + a^6/(6*d*(a - a*sin(c + d*x))^3) + a^5/(8*d*(a - a*sin(c + d*x))^2) + a^4/(8*d*(a - a*sin(c + d*x)))]
    @test_int [sec(c + d*x)^8*(a + a*sin(c + d*x))^3, x, 4, (3*a^3*sec(c + d*x)^5)/(35*d) + (2*a*sec(c + d*x)^7*(a + a*sin(c + d*x))^2)/(7*d) + (3*a^3*tan(c + d*x))/(7*d) + (2*a^3*tan(c + d*x)^3)/(7*d) + (3*a^3*tan(c + d*x)^5)/(35*d)]


    @test_int [cos(c + d*x)^5*(a + a*sin(c + d*x))^8, x, 3, (4*(a + a*sin(c + d*x))^11)/(11*a^3*d) - (a + a*sin(c + d*x))^12/(3*a^4*d) + (a + a*sin(c + d*x))^13/(13*a^5*d)]
    @test_int [cos(c + d*x)^4*(a + a*sin(c + d*x))^8, x, 11, (4199*a^8*x)/1024 - (4199*a^8*cos(c + d*x)^5)/(1920*d) + (4199*a^8*cos(c + d*x)*sin(c + d*x))/(1024*d) + (4199*a^8*cos(c + d*x)^3*sin(c + d*x))/(1536*d) - (323*a^3*cos(c + d*x)^5*(a + a*sin(c + d*x))^5)/(1320*d) - (19*a^2*cos(c + d*x)^5*(a + a*sin(c + d*x))^6)/(132*d) - (a*cos(c + d*x)^5*(a + a*sin(c + d*x))^7)/(12*d) - (4199*a^2*cos(c + d*x)^5*(a^2 + a^2*sin(c + d*x))^3)/(6336*d) - (323*cos(c + d*x)^5*(a^2 + a^2*sin(c + d*x))^4)/(792*d) - (4199*cos(c + d*x)^5*(a^4 + a^4*sin(c + d*x))^2)/(4032*d) - (4199*cos(c + d*x)^5*(a^8 + a^8*sin(c + d*x)))/(2688*d)]
    @test_int [cos(c + d*x)^3*(a + a*sin(c + d*x))^8, x, 3, (a + a*sin(c + d*x))^10/(5*a^2*d) - (a + a*sin(c + d*x))^11/(11*a^3*d)]
    @test_int [cos(c + d*x)^2*(a + a*sin(c + d*x))^8, x, 10, (2431*a^8*x)/256 - (2431*a^8*cos(c + d*x)^3)/(384*d) + (2431*a^8*cos(c + d*x)*sin(c + d*x))/(256*d) - (17*a^3*cos(c + d*x)^3*(a + a*sin(c + d*x))^5)/(48*d) - (17*a^2*cos(c + d*x)^3*(a + a*sin(c + d*x))^6)/(90*d) - (a*cos(c + d*x)^3*(a + a*sin(c + d*x))^7)/(10*d) - (2431*a^2*cos(c + d*x)^3*(a^2 + a^2*sin(c + d*x))^3)/(2016*d) - (221*cos(c + d*x)^3*(a^2 + a^2*sin(c + d*x))^4)/(336*d) - (2431*cos(c + d*x)^3*(a^4 + a^4*sin(c + d*x))^2)/(1120*d) - (2431*cos(c + d*x)^3*(a^8 + a^8*sin(c + d*x)))/(640*d)]
    @test_int [cos(c + d*x)^1*(a + a*sin(c + d*x))^8, x, 2, (a + a*sin(c + d*x))^9/(9*a*d)]
    @test_int [sec(c + d*x)^1*(a + a*sin(c + d*x))^8, x, 3, (-128*a^8*log(1 - sin(c + d*x)))/d - (64*a^8*sin(c + d*x))/d - (16*a^5*(a + a*sin(c + d*x))^3)/(3*d) - (4*a^3*(a + a*sin(c + d*x))^5)/(5*d) - (a^2*(a + a*sin(c + d*x))^6)/(3*d) - (a*(a + a*sin(c + d*x))^7)/(7*d) - (2*(a^2 + a^2*sin(c + d*x))^4)/d - (16*(a^4 + a^4*sin(c + d*x))^2)/d]
    @test_int [sec(c + d*x)^2*(a + a*sin(c + d*x))^8, x, 9, -((3003*a^8*x)/16) + (1001*a^8*cos(c + d*x)^5)/(10*d) - (3003*a^8*cos(c + d*x)*sin(c + d*x))/(16*d) - (1001*a^8*cos(c + d*x)^3*sin(c + d*x))/(8*d) + (2*a^15*cos(c + d*x)^13)/(d*(a - a*sin(c + d*x))^7) + (26*a^13*cos(c + d*x)^11)/(d*(a - a*sin(c + d*x))^5) + (286*a^14*cos(c + d*x)^9)/(3*d*(a^2 - a^2*sin(c + d*x))^3) + (143*a^16*cos(c + d*x)^7)/(2*d*(a^8 - a^8*sin(c + d*x)))]
    @test_int [sec(c + d*x)^3*(a + a*sin(c + d*x))^8, x, 3, (192*a^8*log(1 - sin(c + d*x)))/d + (129*a^8*sin(c + d*x))/d + (36*a^8*sin(c + d*x)^2)/d + (10*a^8*sin(c + d*x)^3)/d + (2*a^8*sin(c + d*x)^4)/d + (a^8*sin(c + d*x)^5)/(5*d) + (64*a^9)/(d*(a - a*sin(c + d*x)))]
    @test_int [sec(c + d*x)^4*(a + a*sin(c + d*x))^8, x, 8, (1155*a^8*x)/8 - (385*a^8*cos(c + d*x)^3)/(4*d) + (1155*a^8*cos(c + d*x)*sin(c + d*x))/(8*d) + (2*a^15*cos(c + d*x)^11)/(3*d*(a - a*sin(c + d*x))^7) - (22*a^13*cos(c + d*x)^9)/(3*d*(a - a*sin(c + d*x))^5) - (66*a^14*cos(c + d*x)^7)/(d*(a^2 - a^2*sin(c + d*x))^3) - (231*a^16*cos(c + d*x)^5)/(4*d*(a^8 - a^8*sin(c + d*x)))]
    @test_int [sec(c + d*x)^5*(a + a*sin(c + d*x))^8, x, 3, (-80*a^8*log(1 - sin(c + d*x)))/d - (31*a^8*sin(c + d*x))/d - (4*a^8*sin(c + d*x)^2)/d - (a^8*sin(c + d*x)^3)/(3*d) + (16*a^10)/(d*(a - a*sin(c + d*x))^2) - (80*a^9)/(d*(a - a*sin(c + d*x)))]


    #= ::Subsubsection::Closed:: =#
    #=m<0=#


    @test_int [cos(c + d*x)^6/(a + a*sin(c + d*x)), x, 4, (3*x)/(8*a) + cos(c + d*x)^5/(5*a*d) + (3*cos(c + d*x)*sin(c + d*x))/(8*a*d) + (cos(c + d*x)^3*sin(c + d*x))/(4*a*d)]
    @test_int [cos(c + d*x)^5/(a + a*sin(c + d*x)), x, 3, -((2*(a - a*sin(c + d*x))^3)/(3*a^4*d)) + (a - a*sin(c + d*x))^4/(4*a^5*d)]
    @test_int [cos(c + d*x)^4/(a + a*sin(c + d*x)), x, 3, x/(2*a) + cos(c + d*x)^3/(3*a*d) + (cos(c + d*x)*sin(c + d*x))/(2*a*d)]
