    @test_int [cos(c + d*x)^2/(a + a*sin(c + d*x)), x, 2, x/a + cos(c + d*x)/(a*d)]
    @test_int [cos(c + d*x)^1/(a + a*sin(c + d*x)), x, 2, log(1 + sin(c + d*x))/(a*d)]
    @test_int [sec(c + d*x)^1/(a + a*sin(c + d*x)), x, 4, atanh(sin(c + d*x))/(2*a*d) - 1/(2*d*(a + a*sin(c + d*x)))]
    @test_int [sec(c + d*x)^2/(a + a*sin(c + d*x)), x, 3, -(sec(c + d*x)/(3*d*(a + a*sin(c + d*x)))) + (2*tan(c + d*x))/(3*a*d)]
    @test_int [sec(c + d*x)^3/(a + a*sin(c + d*x)), x, 4, (3*atanh(sin(c + d*x)))/(8*a*d) + 1/(8*d*(a - a*sin(c + d*x))) - a/(8*d*(a + a*sin(c + d*x))^2) - 1/(4*d*(a + a*sin(c + d*x)))]
    @test_int [sec(c + d*x)^4/(a + a*sin(c + d*x)), x, 3, -(sec(c + d*x)^3/(5*d*(a + a*sin(c + d*x)))) + (4*tan(c + d*x))/(5*a*d) + (4*tan(c + d*x)^3)/(15*a*d)]
    @test_int [sec(c + d*x)^5/(a + a*sin(c + d*x)), x, 4, (5*atanh(sin(c + d*x)))/(16*a*d) + a/(32*d*(a - a*sin(c + d*x))^2) + 1/(8*d*(a - a*sin(c + d*x))) - a^2/(24*d*(a + a*sin(c + d*x))^3) - (3*a)/(32*d*(a + a*sin(c + d*x))^2) - 3/(16*d*(a + a*sin(c + d*x)))]


    @test_int [cos(c + d*x)^8/(a + a*sin(c + d*x))^2, x, 5, (7*x)/(16*a^2) + (7*cos(c + d*x)^5)/(30*a^2*d) + (7*cos(c + d*x)*sin(c + d*x))/(16*a^2*d) + (7*cos(c + d*x)^3*sin(c + d*x))/(24*a^2*d) + cos(c + d*x)^7/(6*d*(a^2 + a^2*sin(c + d*x)))]
    @test_int [cos(c + d*x)^7/(a + a*sin(c + d*x))^2, x, 3, -((a - a*sin(c + d*x))^4/(2*a^6*d)) + (a - a*sin(c + d*x))^5/(5*a^7*d)]
    @test_int [cos(c + d*x)^6/(a + a*sin(c + d*x))^2, x, 4, (5*x)/(8*a^2) + (5*cos(c + d*x)^3)/(12*a^2*d) + (5*cos(c + d*x)*sin(c + d*x))/(8*a^2*d) + cos(c + d*x)^5/(4*d*(a^2 + a^2*sin(c + d*x)))]
